import React,{Component} from 'react';
import {Link} from 'react-router-dom';

export default class NavBar extends Component{
    render() {
        return(
        <nav className="flex flex-wrap w-full justify-center h-16 border-b-2 border-solid font-sans border-gray-300">
            <div class="flex items-center w-full px-6 font-bold">

            <Link to="/" className="text-gray-800 text-lg font-semibold hover:text-green-600 mr-4">Home</Link>
            <div className="md:w-1/2"></div>
            <Link to="/" className="items-end text-gray-800 text-lg font-semibold hover:text-green-600 mr-4">Posts</Link>

            <Link to="/create" className="items-end text-gray-800 text-lg font-semibold hover:text-green-600 mr-4">Create Post</Link>
            <Link to="/user" className="items-end text-gray-800 text-lg font-semibold hover:text-green-600 mr-4">Register User</Link>
            </div>
      </nav>
        );
    }
}
